import React from 'react';
import './style.css';

const Header = () => {
    return (
      <nav>

        <ul>
          <li><a href="#">Home</a></li>
          <li><a href="#">Sobre</a></li>
          <li><a href="#">Habilidades</a></li>
          <li><a href="#">Projetos</a></li>
          <li><a href="#o">Contato</a></li>
        </ul>
      </nav>
    );
  }

  export default Header;
